rameElement.api.opener;win.reloadTable();win.tip(data.msg);frameElement.api.close();}}} $.dialog.setting.zIndex =9999; function del(url,obj){$.dialog.confirm(\"确认删除该条记录?\", function(){$.ajax({async : false,cache : false,type : \'POST\',url : url,error : function() {},success : function(data) {var d = $.parseJSON(data);if (d.success) {var msg = d.msg;tip(msg);$(obj).closest(\"tr\").hide(\"slow\");}}});}, function(){ });}</script><script type=\"text/javascript\">${js_plug_in?if_exists}</script></html>\r\n', '1', '3', '', 'admin', '2018-06-19 16:07:11', '管理员', null);
