INSERT INTO `jp_inner_mail` VALUES ('4028ef8153fe51210153fe5df3bd0001', '管理员', 'admin', '2016-04-10 12:11:23', '112', null, '<h1 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; color: rgb(51, 51, 51); white-space: normal; box-sizing: inherit; font-size: 28px; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; min-height: 1rem; -webkit-font-smoothing: antialiased; cursor: text; position: relative; margin-top: 0px !important; background-color: rgb(255, 255, 255);\">Jeecg-P3 1.0 版本发布，插件开发框架</h1><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">特点：业务组件以JAR方式提供，插件模式、松耦合、可插拔、支持独立部署，也可以无缝集成Jeecg平台中。</p><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; word-break: break-word; line-height: 25px; font-size: 15px; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; color: rgba(0, 0, 0, 0.8); text-align: justify; background-color: rgb(255, 255, 255);\">【架构说明】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">1.Jeecg-P3&nbsp;采用SpringMvc&nbsp;+&nbsp;Minidao&nbsp;+&nbsp;Velocity&nbsp;+&nbsp;Maven(构建)&nbsp;框架技术\r\n2.插件引入方式\r\n&nbsp;&nbsp;&nbsp;&nbsp;pom.xml文件中，引入新开发的插件\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;P3&nbsp;jar&nbsp;--&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;dependency&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;groupId&gt;org.p3framework&lt;/groupId&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;artifactId&gt;jeecg-p3-biz-demo&lt;/artifactId&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;version&gt;1.0.0&lt;/version&gt;\r\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/dependency&gt;\r\n3.项目启动访问方式：\r\n&nbsp;&nbsp;采用maven方式，启动Web项目\r\n&nbsp;&nbsp;http://localhost/jeecg-p3-web/{页面访问地址}\r\n4.页面层面不能采用jsp，需要采用模板语言Velocity\r\n5.插件式开发,每个业务组件以jar包方式提供\r\n6.数据库配置文件：\r\n&nbsp;&nbsp;jeecg-p3-web/src/main/resources/dbconfig.properties</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【项目说明】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">jeecg-p3-web&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;|&nbsp;启动主项目\r\njeecg-p3-biz-demo&nbsp;|&nbsp;插件项目Demo</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【开发入门】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">☆准备工作：\r\n&nbsp;&nbsp;&nbsp;&nbsp;1.标准开发工具：eclipse&nbsp;+&nbsp;jdk7&nbsp;+&nbsp;tomcat7&nbsp;+&nbsp;mysql\r\n&nbsp;&nbsp;&nbsp;&nbsp;2.项目为maven工程，采用maven方式导入eclipse等IDE开发工具&nbsp;\r\n\r\n☆快捷启动：\r\n&nbsp;&nbsp;&nbsp;&nbsp;第一步：创建Mysql数据库jeecg-p3，采用UTF-8编码，执行下面数据库脚本\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;jeecg-p3-web/doc/sql/jeecg-p3-mysql.sql\r\n&nbsp;&nbsp;&nbsp;&nbsp;第二步：双击运行jeecg-p3-web\\bin\\run-tomcat7.bat或bin\\run-tomcat.bat，\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;启动Web服务器（第一次运行，需要下载依赖jar包，请耐心等待）。\r\n&nbsp;&nbsp;&nbsp;&nbsp;第三步：测试访问地址\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;http://localhost/jeecg-p3-web/p3/wxActInvite.do?list\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;http://localhost/jeecg-p3-web/p3/auth.do?list&nbsp;&nbsp;&nbsp;&nbsp;\r\n\r\n☆Eclipse运行步骤：\r\n&nbsp;&nbsp;&nbsp;&nbsp;第一步：创建Mysql数据库jeecg-p3，采用UTF-8编码，执行下面数据库脚本\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;jeecg-p3-web/doc/sql/jeecg-p3-mysql.sql\r\n&nbsp;&nbsp;&nbsp;&nbsp;第二步：采用maven方式启动项目&nbsp;(jeecg-p3-web)\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;项目右建-&gt;debug&nbsp;as-&gt;debug&nbsp;configurations-&gt;选中jeecg-p3-web项目-&gt;输入命令：tomcat:run\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;注意：[1].update&nbsp;snapshots需要选中，官方会不断更新底层包\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[2].插件项目不能单独启动，需以maven方式引入jeecg-p3-web项目中，启动web主项目\r\n&nbsp;&nbsp;&nbsp;&nbsp;第四步：测试访问地址\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;http://localhost/jeecg-p3-web/p3/wxActInvite.do?list\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;http://localhost/jeecg-p3-web/p3/auth.do?list</pre><p style=\"white-space: normal; box-sizing: inherit; margin-top: 0px; margin-bottom: 15px; line-height: 25px; text-align: justify; word-break: break-word; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);\">【代码生成器】</p><pre style=\"white-space: pre-wrap; word-wrap: break-word; box-sizing: inherit; overflow: auto; font-family: Menlo, &#39;Liberation Mono&#39;, Consolas, &#39;DejaVu Sans Mono&#39;, &#39;Ubuntu Mono&#39;, &#39;Courier New&#39;, &#39;andale mono&#39;, &#39;lucida console&#39;, monospace; margin-top: 0px; margin-bottom: 15px; border: none; font-size: 13px; line-height: 19px; padding: 6px 10px; border-radius: 3px; color: rgb(51, 51, 51); background-color: rgb(244, 244, 244);\">1.工具类：jeecg-p3-web/src/main/java/util/P3CodeGenerateUtil.java\r\n2.配置文件：jeecg-p3-web/src/main/resources/p3-cg-config.properties</pre><h1 style=\"margin: 20px 0px 10px; padding: 0px; color: rgb(51, 51, 51); white-space: normal; box-sizing: inherit; font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; line-height: 1.33em; min-height: 1rem; -webkit-font-smoothing: antialiased; cursor: text; position: relative; background-color: rgb(255, 255, 255);\"><a style=\"color: rgb(51, 102, 153);\" name=\"t1\"></a><a target=\"_blank\" class=\"anchor\" id=\"技术交流\" href=\"http://git.oschina.net/jeecg/jeecg-p3#技术交流\" style=\"color: rgb(65, 131, 196); text-decoration: none; font-size: 28px; box-sizing: inherit; cursor: pointer; word-wrap: break-word; display: block; padding-left: 30px; margin-left: -20px; position: absolute; top: 0px; left: 0px; bottom: 0px; background-image: initial; background-attachment: initial; background-color: transparent; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a><span style=\"font-size: 18px;\">技术交流</span></h1><ul class=\"task-list list-paddingleft-2\" style=\"font-size: 14px; white-space: normal; box-sizing: inherit; line-height: 24px; padding-left: 30px; color: rgba(0, 0, 0, 0.8); font-family: Lato, &#39;Helvetica Neue&#39;, &#39;Microsoft YaHei&#39;, Arial, Helvetica, sans-serif; background-color: rgb(255, 255, 255);\"><li><p>论 &nbsp;坛：<a target=\"_blank\" href=\"http://www.jeecg.org/\" style=\"color: rgb(65, 131, 196); text-decoration: none; box-sizing: inherit; word-wrap: break-word; margin-top: 0px; margin-bottom: 0px; cursor: pointer !important; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">www.jeecg.org</a></p></li><li><p>源码下载：<a target=\"_blank\" href=\"http://git.oschina.net/jeecg/jeecg-p3\" style=\"color: rgb(34, 0, 0); text-decoration: none;\">http://git.oschina.net/jeecg/jeecg-p3</a></p></li><li><p>QQ交流群: 106838471</p></li></ul><p><br/></p>', '02', '张代浩', '8a8ab0b246dc81120146dc81819d0053');
INSERT INTO `jp_inner_mail` VALUES ('4028ef81540325190154032622320002', '管理员', 'admin', '2016-04-11 10:28:31', '121212', null, '<p>此版本是一个扁平化UI风格版，提供4套风格供客户选择，让我们共同期待后续版本的到来</p><ol style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(103, 106, 108); font-family: &#39;open sans&#39;, &#39;Helvetica Neue&#39;, Helvetica, Arial, sans-serif; font-size: 13px; line-height: 18.5714px; white-space: normal; background-color: rgb(255, 255, 255);\" class=\" list-paddingleft-2\"><li><p>ACE扁平化风格；</p></li><li><p>代码生成器，支持restful后台代码生成；</p></li><li><p>Online表单提供对外HTTP接口；</p></li><li><p>用户，角色，组织机构，导入功能；</p></li><li><p>多附件上传报错处理；</p></li><li><p>查询过滤器查询报错处理；</p></li><li><p>online代码生成器支持bootstrap表单风格生成；</p></li><li><p>online代码生成器支持上传组件生成；</p></li><li><p>升级minidao；</p></li><li><p>在线文档管理；</p></li><li><p>邮件管理；</p></li><li><p>封装标签：用户标签，组织机构标签；</p></li><li><p>移动报表展示；</p></li><li><p>插件演示；</p></li></ol><p><br/></p>', '02', '张代浩', '8a8ab0b246dc81120146dc81819d0053');
