sp;&nbsp; &nbsp; 代码生成器是单独的数据库配置文件，而且database_name参数必须配置，否则提示错误</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</span><ignore_js_op style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><img id=\"aimg_1788\" aid=\"1788\" src=\"http://www.jeecg.org/data/attachment/forum/201606/24/132052vqi2dfussp3s07sp.png\" zoomfile=\"data/attachment/forum/201606/24/132052vqi2dfussp3s07sp.png\" file=\"data/attachment/forum/201606/24/132052vqi2dfussp3s07sp.png\" class=\"zoom\" width=\"600\" inpost=\"1\" alt=\"QQ图片20160624132255.png\" title=\"QQ图片20160624132255.png\" lazyloaded=\"true\" _load=\"1\" style=\"word-wrap: break-word; cursor: pointer;\"/>&nbsp;</ignore_js_op><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">5.&nbsp;&nbsp;代码生成后，项目启动，提示找不到对应的control，需要spring扫描配置（entity、service、controller）</span><br style=